import React from "react";
import School from "./School";
import SchoolMap from "./SchoolMap";
import Zone from "./zone";
import "./School.css";

function Example() {
  return (
    <div className="container">
      <School />
      <div className="area landscape">
        <SchoolMap />
      </div>

      <div className = "zone">
        <Zone />
      </div>

    </div>
  );
}

export default Example;
